var exports = {};
var RESTUtils = /** @class */ (function () {
    function RESTUtils() {
        throw new Error("Private constructor");
    }
    RESTUtils.parseUrl = function (path) {
        var queryString;
        var queryIndex = path.indexOf("?");
        if (queryIndex > 0) {
            queryString = {};
            path.substring(queryIndex + 1)
                .split("&")
                .forEach(function (keyValue) {
                var keyValueSepIndex = keyValue.indexOf("=");
                if (keyValueSepIndex) {
                    queryString[keyValue.substring(0, keyValueSepIndex)] = keyValue.substring(keyValueSepIndex + 1);
                }
                else {
                    queryString[keyValue] = null;
                }
            });
            path = path.substring(0, queryIndex);
        }
        return {
            path: path,
            parts: path.split("/"),
            queryString: queryString,
        };
    };
    return RESTUtils;
}());
exports.RESTUtils = RESTUtils;
return exports;
